import Container from "../components/Container";

const Index = () => (
  <Container>
    <div>
      <div className="flex">
        <div class="flex-1 text-center h-screen ">
          <h1>Consulta de Saldos</h1>
        </div>
        <div class="flex-1 bg-indigo-600 text-center bg-gray-400 h-screen">
          Medium length
        </div>
      </div>
    </div>
  </Container>
);

export default Index;
